import React, { useState } from "react";
import FormEditModal from "./FormEditModal";

export default function FormTable({ forms, onEdit }) {
  const [selectedForm, setSelectedForm] = useState(null);

  const handleEditClick = form => {
    setSelectedForm(form);
  };

  const handleCloseModal = () => setSelectedForm(null);

  const handleSave = updatedForm => {
    onEdit(updatedForm);
    setSelectedForm(null);
  };

  const tableStyle = {
    width: "100%",
    marginTop: "20px",
    fontFamily: "AnNahar, sans-serif",
    color: "#522524",
    borderCollapse: "collapse"
  };

  const cellStyle = {
    border: "1px solid #ccc",
    padding: "8px"
  };

  return (
    <div>
      <table border="1" cellPadding="8" cellSpacing="0" style={{ width: "100%", marginTop: "20px" }}>
        <thead>
          <tr>
            <th>National ID</th>
            <th>Gender</th>
            <th>First Name</th>
            <th>Father Name</th>
            <th>Grandfather Name</th>
            <th>Last Name</th>
            <th>Phone</th>
            <th>Region</th>
            <th>Area</th>
            <th>Institue</th>
            <th>Profession</th>
            <th>How Did He Hear About Us</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {forms.map(form => (
            <tr key={form.id}>
              <td>{form.nationalID}</td>
              <td>{form.gender}</td>
              <td>{form.firstName}</td>
              <td>{form.fatherName}</td>
              <td>{form.grandFatherName}</td>
              <td>{form.lastName}</td>
              <td>{form.phoneNumber}</td>
              <td>{form.region}</td>
              <td>{form.area}</td>
              <td>{form.institue}</td>
              <td>{form.profession}</td>
              <td>{form.howDidYouHearAboutUs}</td>
              <td>
                <button onClick={() => handleEditClick(form)}>Edit</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      {selectedForm && (
        <FormEditModal
          form={selectedForm}
          onClose={handleCloseModal}
          onSave={handleSave}
        />
      )}
    </div>
  );
}
